import React from 'react';
import './Header.css';
export default function Header(){
     return(
        <>
           <div className="h" id='h'>
            <div className="h-top">
               <div className="links">
                  <a href="#h">Home</a>
                  <a href="#a">Academics</a>
                  <a href="#">Admission</a>
                  <a href="#ab">About Us</a>
                  <a href="#ab">Contact Us</a>
               </div>
            </div>
            <div className="h-bottom">
               <span>ईस मुहमम्द अन्सारी</span> <span>कन्या</span> <span>उ. मा.</span><span> विद्यालय​</span> 
            </div>
           </div>
        </>
     )
}







